import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const CompResultadosBusqueda = () => {
  const { termino } = useParams();
  const [libros, setLibros] = useState([]);
  const [error, setError] = useState('');
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  // Verificar si el usuario está logueado
  const isAuthenticated = () => {
    const token = localStorage.getItem('token');
    console.log("Token en localStorage:", token); // Para depuración
    return !!token;
  };

  // Función para manejar la reserva
  const handleReservar = (id_libro) => {
    console.log("Intentando reservar libro:", id_libro); // Para depuración
    if (isAuthenticated()) {
      console.log("Usuario autenticado, redirigiendo a reserva"); // Para depuración
      navigate(`/reservar/${id_libro}`);
    } else {
      console.log("Usuario no autenticado, redirigiendo a login"); // Para depuración
      navigate('/login', { state: { from: `/reservar/${id_libro}` } });
    }
  };

  // Función para manejar el préstamo
  const handlePrestamo = (id_libro) => {
    console.log("Intentando pedir préstamo de libro:", id_libro); // Para depuración
    if (isAuthenticated()) {
      console.log("Usuario autenticado, redirigiendo a préstamo"); // Para depuración
      navigate(`/prestamo/${id_libro}`);
    } else {
      console.log("Usuario no autenticado, redirigiendo a login"); // Para depuración
      navigate('/login', { state: { from: `/prestamo/${id_libro}` } });
    }
  };

  useEffect(() => {
    const fetchData = async () => {
      setIsLoading(true);
      try {
        const response = await axios.get(`http://localhost:8000/libros/buscar/${termino}`);
        
        if (Array.isArray(response.data)) {
          setLibros(response.data);
        } else if (response.data.message) {
          setError(response.data.message);
          setLibros([]);
        } else {
          throw new Error('Respuesta inesperada de la API');
        }
      } catch (err) {
        console.error('Error al buscar libros:', err);
        setError(err.response?.data?.message || err.message);
        setLibros([]);
      } finally {
        setIsLoading(false);
      }
    };
  
    fetchData();
  }, [termino]);

  if (isLoading) {
    return <div className="container mt-4">Cargando resultados...</div>;
  }

  return (
    <div className="container mt-4">
      <h1 className="mb-4">Resultados de Búsqueda para "{termino}"</h1>
      {error && <div className="alert alert-danger" role="alert">{error}</div>}

      {libros.length > 0 ? (
        <div className="row row-cols-1 row-cols-md-3 g-4">
          {libros.map((libro) => (
            <div key={libro.id_libro} className="col">
              <div className="card h-100">
                <div className="card-body">
                  <h5 className="card-title">{libro.titulo}</h5>
                  <p className="card-text">
                    <strong>Autor:</strong> {libro.autor}<br />
                    <strong>Categoría:</strong> {libro.categoria}
                  </p>
                  <div className="btn-group" role="group" aria-label="Basic example">
                    <button 
                      type="button" 
                      className="btn btn-primary" 
                      onClick={() => handleReservar(libro.id_libro)}
                    >
                      Reservar
                    </button>
                    <button 
                      type="button" 
                      className="btn btn-primary" 
                      onClick={() => handlePrestamo(libro.id_libro)}
                    >
                      Préstamo
                    </button>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-center text-muted">No se encontraron libros para "{termino}"</p>
      )}
    </div>
  );
};

export default CompResultadosBusqueda;
